import React from "react";
import { useNavigate } from "react-router-dom";
import '../styles/Home.css';  // Import the Home.css styles
import bananaImage from '../assets/images/banana.jpeg';  // Correct relative path to the image



function Home() {
    const navigate = useNavigate();
  
    return (
      <div 
        className="home-container" 
        style={{ backgroundImage: `url(${bananaImage})` }} // Set background image dynamically
      >
        <h1>Welcome to Banana Brain Buster!</h1>
        <p>Sign up to start playing!</p>
        <button onClick={() => navigate("/signup")}>Sign Up</button>
        <p>Already have an account?</p>
        <button onClick={() => navigate("/login")}>Log In</button>
      </div>
    );
  }
export default Home;
